data AlexUserState = AlexUserState { filePath :: FilePath }

alexInitUserState :: AlexUserState
alexInitUserState = AlexUserState "<unknown>"

getFilePath :: Alex FilePath
getFilePath = liftM filePath alexGetUserState

setFilePath :: FilePath -> Alex ()
setFilePath = alexSetUserState . AlexUserState

data Token = Token SourcePos TokenClass
  deriving (Show)

data TokenClass =
    TokenModule
  | TokenImport
  | TokenType
  | TokenInterface
  | TokenDefault
  | TokenFun
  | TokenImp
  | TokenTest
  | TokenStruct
  | TokenDef
  | TokenTrue
  | TokenFalse
  | TokenInt
  | TokenBool
  | TokenCharTy
  | TokenUnit
  | TokenIf
  | TokenElse
  | TokenSwitch
  | TokenCond
  | TokenCase
  | TokenAssign
  | TokenArrow
  | TokenRocket
  | TokenCons
  | TokenLBracket
  | TokenRBracket
  | TokenLBrace
  | TokenRBrace
  | TokenLParen
  | TokenRParen
  | TokenLt
  | TokenGt
  | TokenPipe
  | TokenPlus
  | TokenMinus
  | TokenStar
  | TokenFSlash
  | TokenExclamation
  | TokenSemi
  | TokenDot
  | TokenEq
  | TokenColon
  | TokenComma
  | TokenUnderscore
  | TokenNumLit String
  | TokenId String
  | TokenString String
  | TokenChar String
  | TokenEOF
  deriving (Show)


tokValue :: Token -> String
tokValue (Token _ tok) =
  case tok of
    TokenNumLit s -> s
    TokenId s -> s
    TokenString s -> s
    TokenChar s -> s


alexEOF :: Alex Token
alexEOF = do
  fp <- getFilePath
  (p, _, _, _) <- alexGetInput
  return $ Token (sourcePos fp p) TokenEOF

